import React, { useState } from 'react';
var Count=0;

function App(){

    const State = useState();
    let [count,updCount] = useState(0);
     updCount = count++;
     
    function UpdateTime(){
        count++;
    }

    return(
        <>
        <h1>{Count}</h1>
        <button onClick={UpdateTime}>Click Me</button>
        </>
    );
}

export default App;
